import Footer1 from '../Components/footer1';

import '../App.css';
import ProductList1 from '../Components/productlistingproducts1';

function ProductListing1() {
   return (
      <div className="App" >
        <NavBar/>
      <ProductList1/>

        <Footer1/>
        <Footer/>
      </div>
    );
  }

  export default ProductListing1;
